import { storeConstants } from 'library/common/constants';

const initialState = {
    people: [],
};

const ActorsReducer = (state = initialState, action) => {
    switch (action.type) {
        case storeConstants.FETCH_PEOPLE:
            return {
                ...state,
                people: action.payload,
            };
        default:
            return state;
    }
};

export default ActorsReducer;
